import React from 'react';
import Styled from "styled-components";
import LinkedInIcon from '@material-ui/icons/LinkedIn';

function Social() {
  return (
    <Wrapper>
        <Menu>
            <LinkedIn onClick={window.open('https://www.linkedin.com/in/ranga-sashank-2028701a6/', '_blank')}/>

            <a href="https://leetcode.com/rangasashank/" target="_blank">lc</a>
            <a href="https://github.com/rangasashank" target="_blank">gh</a>

        </Menu>
    </Wrapper>
  )
}

export default Social
const Wrapper = Styled.div`
`
const Menu = Styled.div`
`
const LinkedIn = Styled(LinkedInIcon)`
cursor: pointer;
`
